import React from "react";
import Header from "../components/Header";

function About() {
  return (
    <div>
        {/* #wrap */}
        <div id="wrap">
                <Header />
          <div id="container">
            <div className="content" data-role="content">
              <section className="with-fixedBtn">
                <div style={{width:'100%',height:'900px',background:'#ddd'}}>about</div>
              </section>
              <ul className="columnSet selfBottom">
                <li className="colItem"><button type="button" className="btn primary submit layerOpenBtnSample" onClick={e => e.preventDefault()}>팝업 열기</button></li>
              </ul>
            </div>
          </div>
          <footer id="footer"></footer>
        </div>
        {/* //#wrap */}
    </div> 
    
  )
}

export default About;
